document.getElementById('descargarPDF').addEventListener('click', async () => {
  try {
    const response = await fetch('http://localhost:3000/ultimo');
    const registro = await response.json();

    const { nombre, curp, fechaNacimiento, lugarNacimiento } = JSON.parse(registro.data);

    const { jsPDF } = window.jspdf;
    const doc = new jsPDF();

    // üñºÔ∏è Logo en base64 (reemplaza con tu imagen convertida)
    const logoBase64 = "data:image/png;base64,"; // ‚Üê pega aqu√≠ tu base64

    // üßæ Encabezado institucional
    doc.addImage(logoBase64, 'PNG', 20, 10, 30, 20); // x, y, width, height
    doc.setFontSize(14);
  
    doc.text("Direcci√≥n General del Registro Civil", 70, 28);
    doc.line(20, 32, 190, 32); // l√≠nea decorativa

    // üìÑ Datos personales
    doc.setFontSize(12);
    doc.text(`Nombre: ${nombre}`, 20, 45);
    doc.text(`CURP: ${curp}`, 20, 55);
    doc.text(`Fecha de nacimiento: ${fechaNacimiento}`, 20, 65);
    doc.text(`Lugar de nacimiento: ${lugarNacimiento}`, 20, 75);

    // üïì Fecha de emisi√≥n
    const hoy = new Date().toLocaleDateString('es-MX');
    doc.text(`Fecha de emisi√≥n: ${hoy}`, 20, 90);

    // üíæ Descargar PDF
    doc.save("solicitud.pdf");
  } catch (error) {
    console.error("‚ùå Error al generar el PDF:", error);
    alert("Hubo un problema al generar el PDF.");
  }
});